package main

import (
	"bytes"
	"testing"
)

type Case struct {
	Input, Expected string
}

func TestRun(t *testing.T) {
	for _, c := range []Case{
		Case{
			Input: `4
1
3
5
11`,
			Expected: `-1
555
33333
55555533333`,
		},
		Case{
			Input: `5
2194
12002
21965
55140
57634`,
			Expected: `



`,
		},
	} {
		actual := run(bytes.NewBufferString(c.Input))
		if actual != c.Expected {
			t.Fatalf("Input:\n%v\nExpected:\n%v\nActual:\n%v", c.Input, c.Expected, actual)
		}
	}
}
